import React, { Component } from 'react';
import {Nav,Table,Card,Row, Container}from 'react-bootstrap';
import '../../App.css';


class StudentProfile extends Component {
  
    constructor(props) {
      super()
      this.state = {student: JSON.parse( sessionStorage.getItem('student')) }
      console.log(this.state)
      this.state.student.firstname = this.state.student.fname;
      this.state.student.lastname = this.state.student.lname;
      this.state.student.location = this.state.student.location;
      this.state.student.email = this.state.student.emailaddress;
      this.state.student.schoolprogram = this.state.student.school_program;
      this.state.student.dateofbirth = this.state.student.DOB;
    
      // alert('this.state is ' + JSON.stringify(this.state))
      // alert('this.state.student.firstname is ' + this.state.student.firstname)
      // alert('this.state.student.lastname is ' + this.state.student.lastname)
      // alert('this.state.student.location is ' + this.state.student.location)
      

    }

    render() {
        return (
          <Container>

                <div classname="studentform">
                <br/>
                <br/>        
                <br/>
                <br/>
                <br/>
                <br/>
                <h3> {this.state.student.firstname} {this.state.student.lastname}  </h3>

                <Card >
                  <Card.Body style={{border:"none", top:'0px',bottom:'10px',width: '900px'}}>
                    <p>Location: {this.state.student.location}</p>
                    <p>Date of Birth: {this.state.student.dateofbirth}</p>
                    <p>Email: {this.state.student.email}</p>
                    <p>School Program: {this.state.student.schoolprogram}</p>
                    
                  </Card.Body>
                </Card>            

                </div>

                
  </Container>

        );
    }
}

export default StudentProfile;
